import React from "react";
import AddUser from "./components/Users/AddUser";
import UsersList from "./components/Users/UsersList";

function App() {
  return (
    <div>
      <AddUser />
      <UsersList
        users={[
          { name: "Max", age: 28 },
          { name: "Manu", age: 29 },
        ]}
      />
    </div>
  );
}

export default App;
